import './output.css';
import './App.css';

const Sidebar = () => {
  return (
    <div className="w-64 bg-pink-300 sticky top-0 h-screen p-4 flex flex-col space-y-4">
      <h1 className="text-3xl font-sacramento text-pink-700 mb-6">Dashboard</h1>
      <div className="flex flex-col space-y-2">
        <a href="/dashboard" className="text-xl font-sacramento text-pink-800 hover:bg-pink-400 p-2 rounded">My Journals</a>
        <a href="/favs" className="text-xl font-sacramento text-pink-800 hover:bg-pink-400 p-2 rounded">Favourites</a>
        <a href="/affirmations" className="text-xl font-sacramento text-pink-800 hover:bg-pink-400 p-2 rounded">Affirmations</a>
        <a href="/community" className="text-xl font-sacramento text-pink-800 hover:bg-pink-400 p-2 rounded">Community</a>
        <a href="/insights" className="text-xl font-sacramento text-pink-800 hover:bg-pink-400 p-2 rounded">Insights</a>
      </div>
    </div>
  );
};

export default Sidebar;
